package com.echair.project_manage.common.result;


import com.alibaba.fastjson.JSON;

/**
 * @description: response
 * @author: wjk
 * @date: 2020/5/8 15:50
 **/
public class Response<T> {
    private Boolean success;
    private String code;
    private String message;
    private String errMessage;
    private T data;

    public Response(){
        super();
    }

    public Response(Boolean success, String code, String message, String errMessage, T data) {
        super();
        this.success = success;
        this.code = code;
        this.message = message;
        this.errMessage = errMessage;
        this.data = data;
    }

    public Boolean getSuccess() {
        return success;
    }

    public void setSuccess(Boolean success) {
        this.success = success;
    }

    public String getErrMessage() {
        return errMessage;
    }

    public void setErrMessage(String errMessage) {
        this.errMessage = errMessage;
    }

    public String getCode() {
        return code;
    }

    public void setCode(String code) {
        this.code = code;
    }

    public String getMessage() {
        return message;
    }

    public void setMessage(String message) {
        this.message = message;
    }

    public T getData() {
        return data;
    }

    public void setData(T data) {
        this.data = data;
    }

    public static <T> Response<T> success(T t) {
        Response r = new Response();
        r.setErrMessage("");
        r.setSuccess(true);
        r.setCode("200");
        r.setMessage("success");
        r.setData(t);
        return r;
    }
    public static <T> Response<T> success(T t, String message) {
        Response r = new Response();
        r.setErrMessage("");
        r.setSuccess(true);
        r.setCode("200");
        r.setMessage(message);
        r.setData(t);
        return r;
    }
    public static <T> Response<T> fail(String errMessage) {
        Response r = new Response();
        r.setCode("-1");
        r.setMessage("fail");
        r.setErrMessage(errMessage);
        r.setData(null);
        return r;
    }

    public static <T> Response<T> fail(T t,String errMessage) {
        Response r = new Response();
        r.setCode("-1");
        r.setMessage("fail");
        r.setSuccess(false);
        r.setErrMessage(errMessage);
        r.setData(t);
        return r;
    }
    public String toString() {
        return JSON.toJSONString(this);
    }

    public static void main(String[] a) {
        String s="data:image/jpg;base64,";
        System.out.println(s.length());
        byte[] bytes = s.getBytes();
        System.out.println(bytes.length);
    }
}
